import { render } from '@testing-library/react';
import React from 'react';
import ReactDOM  from 'react';
import reactDom from 'react-dom';
let name = "arun";
const lname = "solanki"
reactDom.render(<><h1>hello i am {name} {lname}</h1>
        <h1>list of 5 items</h1>
        <ol>
          <li><h1>maa tujhe salam</h1></li>
          <li>bajrangi bhaijaan</li>
          <li>bahubali</li>
          <li>suryawanshi</li>
          <li>thakur saheb</li>
        </ol>
</> , document.getElementById("root"));
